-- ----------------------------
-- Table structure for blog
-- ----------------------------
DROP TABLE IF EXISTS `blog`;
CREATE TABLE `blog`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID编号',
  `title` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '博客标题',
  `summary` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '博客摘要',
  `content` longblob NULL COMMENT '博客内容',
  `date` datetime(0) NULL DEFAULT NULL COMMENT '发布时间',
  `type` int(11) NULL DEFAULT NULL COMMENT '所属专栏',
  `views` int(10) UNSIGNED NULL DEFAULT 665 COMMENT '浏览量',
  `tags` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '标签',
  `comments` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '评论',
  `pictureUrl` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '首图地址',
  `isRecommend` int(11) NULL DEFAULT 0 COMMENT '是否开启推荐',
  `isReprint` int(11) NULL DEFAULT 0 COMMENT '是否开启转载声明',
  `isAppreciation` int(11) NULL DEFAULT 0 COMMENT '是否开启赞赏',
  `isComment` int(11) NULL DEFAULT 0 COMMENT '是否开启评论',
  `property` int(11) NULL DEFAULT NULL COMMENT '1.原创；2.转载；3.翻译',
  `state` int(11) NULL DEFAULT 0 COMMENT '状态：0.草稿；1.已发布',
  PRIMARY KEY (`id`, `title`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 57 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of blog
-- ----------------------------
INSERT INTO `blog` VALUES (37, '【一年总结】记我的大一生活', '去年夏天，平平无奇的我过着平平无奇的生活。 一年之后，依旧是那个夏天，依旧是那个我，只是此时的我成了别人口中的“大佬”。而同是参加软件创新实验室的集训，别人是听课的那个，而我是讲课的那个。我感慨无限，是啊，奋斗真的可以改变人呢！', , '2020-07-04 15:27:23', 12, 599, ',10,9,11,13,14,', NULL, 'https://img-blog.csdnimg.cn/20200725150352635.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (38, '如何去寻找解决bug？（以Mapped Statements collection does not contain value for xxx的异常为例）', '如何去寻找解决bug？我将阐述我自己的理解和找bug的经历，希望对你有所帮助！', , '2020-07-23 20:04:20', 13, 30, ',11,', NULL, 'https://img-blog.csdnimg.cn/20200725150427127.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (39, '【项目实战】 图书信息管理系统（Maven，mybatis）（第一个自己独立完成的项目）', '《程序设计综合训练实践报告》 此项目为图书信息管理系统，是一个采用了mysql+mybatis框架+java编写的maven项目', , '2020-06-22 22:42:51', 15, 905, ',15,16,12,11,', NULL, 'https://img-blog.csdnimg.cn/20200725150427472.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (40, 'IDEA中建包时如何把包分开', '你写mybatis-config.xml配置文件时，采用包扫描时就会报错，因为你会发现尽管mapper.xml和接口文件在同一个包中，但是编译到target文件夹时，这两个文件就会分道扬镳，一个在com.XXX/mapper中，一个在com/XXX/mapper包中。', , '2020-06-30 09:43:19', 14, 21, ',17,11,', NULL, 'https://img-blog.csdnimg.cn/20200725150428837.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (41, '如何理解对象赋值给接口的操作（关键在对象！）', '如果一个对象赋值给它的接口，那么这个用接口“接”的对象只有接口所定义的方法和属性，失去了原本对象独有的方法和内容。 按我之前的理解就是——如果把原对象比作一辆拥有众多功能的跑车，那么接口就是大家统一规格的...', , '2020-05-12 15:22:28', 13, 91, ',11,14,', NULL, 'https://img-blog.csdnimg.cn/20200725150428892.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (42, '用Java写数据结构作业——7-2 任务调度的合理性 (25分)', ' 假定一个工程项目由一组子任务构成，子任务之间有的可以并行执行，有的必须在完成了其它一些子任务后才能执行。“任务调度”包括一组子任务、以及每个子任务可以执行所依赖的子任务集。 比如完成一个专业的所有课程学习和毕业设计可以看成一个本科生要完成的一项工程，各门课程可以看成是子任务。', , '2020-05-11 18:34:38', 16, 34, ',11,', NULL, 'https://img-blog.csdnimg.cn/20200725150429559.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (43, '6-1 最小生成树（普里姆算法） (10分)', '说真的，太久太久没写c语言的程序了，写的极不习惯，c语言的程序调试起来还贼麻烦，几个小错误反复调了好久才找到，着实不容易啊。写个函数题就花了我两小时，唉。。。。。。。', , '2020-05-07 17:51:32', 17, 21, ',18,', NULL, 'https://img-blog.csdnimg.cn/20200725150429558.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (44, 'Java学习日志——springmvc中moudle里的数据渲染不进view里', 'springmvc中moudle里的数据为什么渲染不进view里？ 今天学springMVC时moudle里的数据死也渲染不进view中，然后上网找了各种方法都没用，反倒是把顺便把springMVC的原理给复习了一遍。 问题如下图：  这里我们看到我们代码写的什么，他就传了什么过来，一点渲染都不带...', , '2020-05-04 18:06:46', 14, 5, ',19,11,', NULL, 'https://img-blog.csdnimg.cn/20200725150429608.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (45, '真正的四舍五入', '原文地址：https://blog.csdn.net/qwfylwc/article/details/53939906 下面列举让你惊讶的现象，或许你还一直这么用： 1、使用Math.round()   double d = 1041.735;   d = Math.round(d*100)/100.0; //除以100.0 而不是100   System.out.println(d); //输出...', , '2020-04-19 12:12:18', 18, 31, ',11,', NULL, 'https://img-blog.csdnimg.cn/20200725150430100.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 0, 1, 1, 2, 1);
INSERT INTO `blog` VALUES (46, '用Java写数据结构作业——7-2 Dijkstra算法（模板） (30分)', '7-2 Dijkstra算法（模板） (30分) 给一个n(1 ≤ n ≤ 2500) 个点 m(1 ≤ m ≤ 6200) 条边的无向图，求 s 到 t 的最短路。 输入格式: 第一行四个由空格隔开的整...', , '2020-04-28 18:05:36', 16, 23, ',11,', NULL, 'https://img-blog.csdnimg.cn/20200725150429854.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (47, '用Java写数据结构作业——7-1 哈利·波特的考试 (25分)', '7-1 哈利·波特的考试 (25分) 哈利·波特要考试了，他需要你的帮助。这门课学的是用魔咒将一种动物变成另一种动物的本事。例如将猫变成老鼠的魔咒是haha，将老鼠变成鱼的魔咒是hehe等等...', , '2020-04-28 12:47:22', 16, 33, ',11,', NULL, 'https://img-blog.csdnimg.cn/20200725150430100.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (48, 'Idea访问servlet404问题（java学习日志）', '** java学习日志——Idea访问servlet404问题 ** 最近学了servlet后开始尝试自己部署项目，无论是eclipse还是idea我都试过。但一路上的坎坷只有自己清楚。其中部署项目时最心酸也是困扰我最久...', , '2020-03-21 10:01:50', 14, 21, ',11,10,', NULL, 'https://img-blog.csdnimg.cn/20200725150430235.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (49, '用Java写数据结构作业——7-1 拯救007', '7-1 拯救007 (25分) 在老电影“007之生死关头”（Live and Let Die）中有一个情节，007被毒贩抓到一个鳄鱼池中心的小岛上，他用了一种极为大胆的方法逃脱 —— 直接踩着池子里一系列鳄鱼的大脑袋跳上岸去！（据说当年替身演员被最后一条鳄鱼咬住了脚，幸好穿的是特别加厚的靴子才逃过一劫)...', , '2020-04-18 23:14:21', 16, 39, ',11,', NULL, 'https://img-blog.csdnimg.cn/20200725150431300.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (51, 'maven详解（软件创新实验室讲课稿）', '由于软件创新实验室讲课要求，所以我写下这篇博文。一方面是为了自己讲课方便，另一方面是为了听课的同学更有目的、更有效率的去听讲。  此篇博客讲的是maven的基础知识以及我在写maven项目时的一些经验和理解。', , '2020-08-05 11:36:35', 13, 557, ',11,16,', NULL, 'https://img-blog.csdnimg.cn/20200807165220518.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (52, '用我的亲身经历来告诉你如何自学Java？', '在我的另一篇博文——【一年总结】记我的大一生活中，我其实已经谈过了我的大一经历，但是对于我自学Java的地方往往都是一笔带过的，因为那篇博文主要是想记录我那时所思所想，表达的主要是一种情感，而非“攻略”。  所以我觉得我有必要另起一篇来专门讲讲我是如何一步一步自学Java的。', , '2020-07-27 20:52:20', 13, 679, ',10,11,', NULL, 'https://img-blog.csdnimg.cn/20200807165220829.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (53, '【项目实战】个人博客（SpringBoot，SSM，thymeleaf，Semantic UI）——从设计思路到部署一站式教学', '此项目为个人博客系统，采用SpringBoot，SSM，thymeleaf，Semantic UI等技术，我将从设计思路开始讲起，再到成品，再到项目部署，一站式服务。此系统分前台和后台。前台负责展示你的博客，且页面适配移动端。管理员可以登录后台来对博客、分类、评论等进行管理。', , '2020-07-26 18:26:38', 15, 1036, ',12,21,22,23,', NULL, 'https://img-blog.csdnimg.cn/20200807165220888.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (54, '分布式微服务学习总结——分布式微服务概述', '最近刚看完springcloud、dubbo的学习视频，但感觉不是那么扎实，所以打算写一个系列的博客来巩固自身所学。 当然有些内容是参考了别的博客，毕竟我也是初探分布式微服务的，并不是所谓的大神，只是一个新手在初探分布式微服务后写下的一些自己的理解和总结。', , '2020-08-19 16:37:09', 19, 17, ',24,25,26,', NULL, 'https://img-blog.csdnimg.cn/20200807165220952.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (56, '分布式微服务学习总结——Eureka详解', '我们之前说了分布式微服务概述，聊了聊分布式微服务这种架构思想。 那么今天我们聊一聊Netflix全家桶“五大神兽”之一——Eureka。在这篇博文，我会介绍Eureka原理、机制、设计思想以及使用过程。', , '2020-08-22 11:54:10', 19, 29, ',24,25,27,', NULL, 'https://img-blog.csdnimg.cn/20200807165222837.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (57, '分布式微服务学习总结——Ribbon和Feign', '在了解了概述和Eureka之后，我们对于分布式微服务架构有了初步的认识，本文将介绍Netflix系列的另一大“神兽”——Ribbon，以及通过其封装的Feign，我将会详细介绍两者以及使用方式，希望能给各位一个较为清晰的认识。', , '2020-08-23 19:14:05', 19, 5, ',24,25,28,29,', NULL, 'https://img-blog.csdnimg.cn/20200807165223540.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);

